import React from 'react'

const Header = () => {
  return (
    <div>
       <button class="btn" id="loginButton" style="display: block;"><a href="/login" style="color:black;">Login/Register</a></button>
       <button class="btn1" id="userButton" style="border-radius: 80%; color :white;transform:translateX(40%); display: none;"><div id="username"></div></button>
    </div>
  )
}

export default Header
